            sendChat('Akashic Paths','Map creation commands will include tokens, the map, the dynamic lighting. Tokens have their health in the red bar, and have their armor class in the green bar with the format normal/touch, and in the blue bar will include "notes" if the token has custom notes written in the "GM Notes". All tokens in the playtest will also have their stat card linked inside of their GM notes. (right-click -> open link in new tab is the easiest way to open it). Items on the GM layer will say what checks they require to be obtained, if it has two different options it will list both, one in the red bar, one in the green, with the DC in the blue bar. If an item has more additional info required it will instead have "notes" in the blue bar, and the info will be in the GM notes of that item. On some maps there are books in specific areas, these will contain relevant information on the area. There is a copy of each token used in the map on the left side of the map, or for arena maps they are what is used to spawn monsters.')
